   from ft_t_edmv e join ft_t_idmv dv on dv.intrnl_dmn_val_id =e.intrnl_dmn_val_id where e.end_tms is null and e.data_src_id ='BB' and dv.fld_id in ('00162227')
    and not exists (select 1 from ft_t_edmv e1 where e1.data_src_id = 'NUVEEN' and e1.intrnl_dmn_val_id = e.intrnl_dmn_val_id and e1.ext_dmn_val_txt = e.ext_dmn_val_txt); 

